import React from "react";

const Carousel = () => {
  const custom_css = {
    display: "grid",
    gridTemplateRows: "500px",
    alignItems: "center",
    textAlign: "center",
  };

  return <div style={custom_css}> Carousel</div>;
};

export default Carousel;
